import {CREATE_ROOM} from "../actions";

const initialState = {
    title: 'もちまっちげーみんぐ',
    test: 'test',
    room: 0
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            setState(state.room = state.room++);
            state.room++;
            console.log("TEST");
            console.log(state);
            console.log("TEST");
            return state;

        default:
            return state;
    }
}

export default testReducer;
